["sounds2.pac_0242c1a3.ogg"] = {"Nie ma co się tak od razu denerwować, ludzie kochani! Dobrze, oczywiście. Ach tak! Trzeba było powiedzieć tak od razu. Wie pan, ja bardzo lubię mówić. O muzyce, o sztuce w ogóle zwłaszcza. Często. Bardzo! Tak, a czy zwrócił pan uwagę na kasety w przecenie? Można znajdzie pan tam coś dla siebie, proszę spróbować, jak będzie miał pan ochotę. Mamy bardzo szeroki asortyment – szereg składanek metalowych, czill-auty takie w sam raz na zrzut, dużo bardzo tłustych bitów, do tego całe mnóstwo klasyki. Ach! No i byłbym zapomniał o wspaniałej kolekcji muzyki barokowej! To prawdziwa perła! Siedemnaście płyt kompaktowych lub dziewiętnaście kaset po cenie, która wprawdzie może zdawać się nieco wygórowana, lecz zapewniam, że...", "Jan_Winyl_139_Akt1_2"},
