["sounds2.pac_02390869.ogg"] = {"Tak, tak. Już podaję odtwarzacz. Z tym, że nie wiem, czy pan wie, ale według mnie to hip-hop, zwłaszcza polski, skomercjalizował się o wiele za szybko. Zanim jeszcze zdążył, powiedzmy, okrzepnąć. Młodzi ludzie, wyrośli z jakichś tam składów, formacji, rozpoczynają teraz solowe kariery. Ale czy widać różnicę między ich pracami solowymi a tym, co robili razem z kolegami? To w zasadzie wciąż to samo! Brakuje trochę dystansu. Z drugiej strony, doskonale rozumiem, że się chłopaki spieszą. Nie wiadomo, dla kogo jeszcze miejsca starczy na tym – już nie wiem, jakiego słowa użyć – panteonie.", "Jan_Winyl_129"},
