["sounds2.pac_046010fa.ogg"] = {"Ów szatański kot wciąż podąża mym śladem i nieustannie czuć muszę jego wszechwiedzące oko śledzące moje poczynania. Najgorsze jest jednak to, że pazurami szarpie on korę. A dźwięk kory padającej na asfalt jest zbyt wielką torturą dla moich wieszczych uszu.", "Towarzysz_Roman_Akt3_3_Pop_119"},
