["sounds.pac_0666f052.ogg"] = {"Fajny bębenek.", "Fred_3234_Akt2_1"},
["sounds2.pac_02a6b818.ogg"] = {"W sumie, to nie masz się czym przejmować, bo to tylko lokalna legenda. Takie, jak to mówią, gusło. Wprawdzie w każdej legendzie istnieje jakieś tam ziarno prawdy, ale kto za tym trafi... Bo to już od tylu lat ta legenda tu krąży, że na przykład ja już nie wiem, czy to on zabija, czy to jego zgwałcili... Życie to nie teatr, drogi przyjacielu.", "Jzhgpo_2785_Akt2_1"},
["sounds2.pac_02a578f4.ogg"] = {"Nie boisz się tak chodzić samemu po nocy?", "Jzhgpo_2780_Akt2_1"},
["sounds2.pac_02a39a0d.ogg"] = {"Poza tym, cieszę się z bliskości pamiątki po przodkach. Afryka to kolebka ludzkości, człowieku. A ta maska na drzewie symbolizuje łączność z naszymi przodkami. Człowieku.", "Jzhgpo_2775_Akt2_1"},
