["sounds2.pac_029f9c65.ogg"] = {"Siemano, bracie! Wyrwaliśmy cię z objęć śmierci!", "Jzhgpo_2762_Akt2_1"},
["sounds2.pac_029e4e4e.ogg"] = {"W moim wieku też będziesz ponury, gówniarzu!", "Jorge_Akt3_2_P_3105"},
["sounds2.pac_029b3fcc.ogg"] = {"Ten świecznik stoi tu ku chwale naszego Pana, głupcze!", "Jorge_Akt3_2_P_3037"},
["sounds2.pac_02afbd0d.ogg"] = {"Mój brat, który wraz ze mną przemierza świat podczas nocy! Co cię sprowadza do mnie? Potrzebujesz rady? Wysokich lotów?", "Jzhgpo_2812_Akt2_1"},
