["sounds.pac_08ffd519.ogg"] = {"Oo?", "Fred_Akt3_3_Pop_2465"},
["sounds.pac_07cd7300.ogg"] = {"Słyszałem, jak scenarzyści rozmawiali. Że rysownik, pan Artysta, odmówił rysowania kolejnego Dilera, a poza tym, to oni stwierdzili, że będzie taniej z jednym Dilerem, choćby jeśli wziąć pod uwagę koszty nagrań aktorów...", "Fred_890_Akt1_2"},
