["sounds2.pac_01ac7a0a.ogg"] = {"Ej, Fred...", "Grucha_Grucha_clips_294"},
["sounds.pac_07c299d8.ogg"] = {"Nie, nie trzeba! Ten dresik tak się podoba mojemu koledze, że nie chce chodzić w niczym innym. To, że nie ma teraz tego dresu na sobie, jest zrządzeniem zgoła losowym. On bardzo lubi dresy, wie pani.", "Fred_826_Akt1_2"},
["sounds2.pac_026c2466.ogg"] = {"Nie przejdziecie tędy! Ja, konfrater Jorge ze zgromadzenia świętego Franciszka, będę strzegł tego przejścia do ostatniej kropli krwi! Mojej albo waszej.", "Jorge_2179Akt3_3"},
["sounds.pac_07607739.ogg"] = {"No wsiadasz czy nie? Wszystko wytłumaczę ci po drodze!", "Fred_5191_prolog"},
["sounds2.pac_047de635.ogg"] = {"Witam, witam! Może coś jeszcze znajdzie się dla panów?", "Wlascicielka_sklepu_z_tekstyliami_825_Akt1_2"},
["sounds.pac_08fc2b0d.ogg"] = {"Pieniek do rąbania kur.", "Fred_Akt3_2_P_477"},
["sounds2.pac_026768c8.ogg"] = {"A w sumie dlaczego nie? Niech będzie! Tyle że ja jestem głodny. Bardzo głodny. Ale upiornie nie chce mi się stąd ruszać, słuchaj. Skołuj mi coś do jedzenia, a ja podpiszę każdy dokument, jaki możesz potrzebować.", "Jehowy_2842_Akt2_1"},
["sounds.pac_0807b992.ogg"] = {"Grób, który wykopany został niedawno. Nie jest jeszcze skończony. No bo... Tu można byłoby trochę pogłębić, a tutaj poszerzyć i mamy grób jak marzenie! Grób, że proszę państwa, żyć nie umie... No nie, to akurat głupie.", "Fred_Akt2_P2_1945"},
["sounds.pac_071ad919.ogg"] = {"Po ci mi cała jabłonka?", "Fred_427_Akt2_1"},
["sounds.pac_0870ec5b.ogg"] = {"To nie ja! COŚ mi każe!", "Fred_Akt3_1_P_2845"},
["sounds2.pac_026368a4.ogg"] = {"Człowieku, no, prosiłem cię!", "Jeden_Z_Hipisow_Grajacych_Przy_Ognisku_Akt2_P_764"},
["sounds.pac_0621568a.ogg"] = {"Taa, jasne. Już pędzę.", "Fred_2923_Akt2_1"},
["sounds2.pac_0257b273.ogg"] = {"Ale czy w sztuce, nawet masowej, o to naprawdę chodzi? Prawdziwy, taki uliczny przekaz to jakby jedno, ale przecież obserwujemy teraz wyraźną tenedencję do uproszczeń, głównie w sferze, że tak się wyrażę, lirycznej. Proszę zwrócić uwagę, że nie liczy się dziś flow ale to, ile kto ma na koncie. A nie? Jak nie, jak tak! Nie ma się dzisiaj stylu, tylko ma się stajla, a brudne, ciemne ulice ustępują błyszczącym marynarkom, złotu i tunelom aero... arera... Tfu! Areodynamicznym. Ale, jak dla mnie, to to jest nie hip-hop ale hip-hopolo.", "Jan_Winyl_187_akt_1_2"},
["sounds.pac_06b6308e.ogg"] = {"Jest obwieszony materiałami wybuchowymi. Bardziej niż arabski fundamentalista.", "Fred_3633_Akt2_2"},
["sounds2.pac_02502151.ogg"] = {"Tak, tak – nawet polski hip-hop nie napędził koniunktury. Oczywiście, pojawiają się nowi odbiorcy, często coraz młodsi jak mniemam, ale w sklepach wciąż sprzedajemy nikłe ilości. Stąd te wszystkie promocje, płyty dwie w cenie jednej, no festiwale, degustacje, muzyczna jedynka i promocja tego, co najbardziej promowane. Tak, tak, znam się na tym, bo jestem, było nie było, w tym interesie od lat... A o czym to ja? Aha! Ja wiem, jak rozumiem, że człowiek orze jak może, byle tylko związać koniec z końcem, proszę panów...", "Jan_Winyl_186_akt_1_2"},
["sounds2.pac_024e8af4.ogg"] = {"Hej, hola hola! Ja płacę za ten prąd, panowie! A musicie wiedzieć, że w przemyśle fonograficznym nie ma lekko...", "Jan_Winyl_185_akt_1_2"},
["sounds2.pac_024db2a5.ogg"] = {"Taaak. O muzyce mógłbym rozprawiać często i chętnie. Bardzo.", "Jan_Winyl_162_Akt1_2"},
["sounds.pac_04ab2800.ogg"] = {"Chleba i dżemu?", "Fred_172Akt3_3"},
["sounds.pac_06b14ee2.ogg"] = {"Naprawa gazika potrwałaby jeszcze dłużej, gdyby nie ta latarka.", "Fred_3594_Akt2_2"},
["sounds2.pac_024c1492.ogg"] = {"O! To znowu pan! Wie pan, przypomina mi się taka historia, że...", "Jan_Winyl_151_Akt1_2"},
["sounds.pac_08452f1c.ogg"] = {"No dobrze, przedostałem się tamtędy... To już jeden punkt dla mnie. Teraz szybko wydostań nas stąd.", "Fred_Akt2_P2_952"},
["sounds2.pac_024a37f5.ogg"] = {"Proszę, oto odtwarzacz. W środku jest składanka, będzie miał pan odpowiedni przekrój przez style, wibracje. No tak, ale ja już może przestanę gadać.", "Jan_Winyl_141_Akt1_2"},
["sounds2.pac_023f3608.ogg"] = {"Musi pan zwrócić szczególną uwagę na wymowę polskich twórców. Nie twierdzę, że to wszyscy tak mają, ale wielu artystom udało się opanować sztukę mówienia z gorącym ziemniakiem w ustach. Nie wiem, czy pan rozumie, o czym ja..., ale chodzi mi o to całe: „Elo, ziesiak, ja si pofiem, ja żyś, hawudepe, pozdro dla moich ludzi, elo”.", "Jan_Winyl_131"},
["sounds.pac_087bef23.ogg"] = {"Aldona żyje w ciągłym biegu.", "Fred_Akt3_1_P_3399"},
["sounds.pac_03c509da.ogg"] = {"Bardzo klimatyczny bluszcz.", "Fred_1089Akt3_3"},
["sounds2.pac_02370b55.ogg"] = {"Ale proszę mi powiedzieć. Gdzie ta nowa wrażliwość? Czy wyraża się tym, że można się kolegować z szampanem? Czy mam mówić dalej?", "Jan_Winyl_119_Akt1_2_p3"},
["sounds2.pac_023328e0.ogg"] = {"Dlaczego? Ha ha! Bo opowiada o tym, co go otacza. Tak właśnie, proszę pana. Jaki jest świat, taki jest rap. Czyli, że przesrane, proszę pana. Czyli o życiu młodego człowieka. Bez pieniędzy. Co gorsza jednak – w znacznej mierze bez perspektyw. Szare bloki, ci sami ludzie, no codzienne problemy. Proszę zauważyć, jak rzadko pojawia się tutaj urzeczywistnienie mitu bogactwa.", "Jan_Winyl_119_Akt1_2_p2"},
["sounds.pac_0470c3c6.ogg"] = {"A co się stało?", "Fred_1578_Akt3_2"},
["sounds.pac_0740932b.ogg"] = {"W środku jest jakiś traktor czy coś w tym stylu. Niestety, nie dojadę nim na północ.", "Fred_4920_Akt2_1"},
["sounds2.pac_022e6bd8.ogg"] = {"No.. ale z drugiej strony, przecież William Cockson, wie pan, gitarzysta rytmiczny z Fungus Dei, też nie miał za sobą szkoły muzycznej, tylko lokalną politechnikę, na której uczył się mechaniki kwantowo-tachjonowej i robotyki z elementami nekromancji.", "Jan_Winyl_116_Akt1_2_p3"},
["sounds2.pac_022c842e.ogg"] = {"A przygotowanie merytoryczne? Ba! Czymże jest dla nich staccato albo czy odróżnić są w stanie klawesyn od klawikordu? Wątpię, wie pan? Wątpię!", "Jan_Winyl_116_Akt1_2_p2"},
["sounds.pac_03267765.ogg"] = {"Ooo... Już dwunasta? No... To trzeba wstawać.", "Aldona_2970_Akt3_1"},
["sounds.pac_042e5091.ogg"] = {"Rważesz mać. No rany boskie jak można tak pi... od rzeczy!?", "Fred_132"},
["sounds2.pac_02291b12.ogg"] = {"Tak, tak. Oczywiście, nie ma problemu przecież najmniejszego. Wie pan, hip-hop, przynajmniej z samego początku, funkcjonował trochę na zasadzie jakiejś nowej kategorii wrażliwości muzycznej. Nowa forma, młodzi artyści, którzy przecież nie byli emocjonalnie przygotowani na tak spektakularny sukces...", "Jan_Winyl_116_Akt1_2_p1"},
["sounds.pac_0557d3c6.ogg"] = {"Włącznik światła w stodole.", "Fred_2331_Akt2_1"},
