["sounds2.pac_00a857ae.ogg"] = {"Daj spokój. Ten pan ma wrzody.", "Grucha_2163_Akt3_1"},
["sounds2.pac_04182700.ogg"] = {"Bo widzi pan, komplet mamy i nic, normalnie nic nie da się zrobić, panie. Nooo chyba że, jak to się mówi? Jak się da, to się zrobi, he he he.", "Stroz_parkingowy_114_Akt1_1"},
