["sounds2.pac_04e1ff1d.ogg"] = {"Więc jadę do bitu równo miarowo, nie spieszę się nigdzie, robię to z głową, są różne tematy: laseczki, bataty, imprezki, bitwy, skracze i cuty. Telewizja, Irak, wojna, pożoga, prawda i fałsz, radość i trwoga. Przechwałki, lamusy na nartach są szusy. Znajdziesz też tutaj plusy, minusy. Blink blink pi... z jedwabiu obrusy. Dolary, ofiary, sokiści, kanary, graffiti, z marychy duszące opary. Policja, ambicja, krawędź, podłoga, sportowy wózek, co dach mu się chowa. I nie wiem, nie mam, nie wiem, nie umiem. Zarobiony jestem... Poza tym znowu muszę złapać bucha...", "Ziom_Trzeci_AKT1_P_2015"},
