["sounds2.pac_01ee4f06.ogg"] = {"Świeżutkie hot-dogi, american styl i w ogóle! Barrrdzo dobre hot-dogi, z majonezem i musztardą albo sosem krewetkowo-wołowym! Może chcecie kupić naszego specjalnego hot-doga, który... heh heh heh... Jest także z bekonem, mieloną wieprzowiną i skrzydełkami! I to wszystko w dietetycznej bułeczce! Panowie się skusicie, co? Jesteście tego warci!", "HotDogMan_1092_Akt1_1"},
["sounds2.pac_01ea2339.ogg"] = {"On mi chciał fast fooda zabrać,  ten spadł w zieleniak, a pan - hyps, jak normalnie Boga kocham - i rozumiesz pan,  tego fast fooda żeś zabrał.", "HotDogMan_1069_Akt1_1"},
