["sounds.pac_096ea6f7.ogg"] = {"Na waszej mapie zaznaczyłem kilka miejsc, które powinniście odwiedzić. Odwiedzić, by nieść tam Słowo Pana! Chwalmy Pana!", "FZB_2151_Akt1_1"},
