["sounds.pac_0987d172.ogg"] = {"Niezbadane są wyroki boskie, powiadam! Niezbadane! To, że pojawiam się w taki, a nie inny sposób, zależne jest nie tyle ode mnie, ile od sprawowanej przeze mnie funkcji. Nie ma lekko, Fred.", "FZB_4309_Akt3_1"},
["sounds.pac_098ac183.ogg"] = {"Widzisz klasztor, prawda? W jego katakumbach znajduje się pradawny skarb... Relikwia, której nie można oglądać... Relikwia, której potrzebujemy...", "FZB_4313_Akt3_1"},
["sounds.pac_098f9c0b.ogg"] = {"Przynieś tu dziś pod wieczór szkatułkę z relikwią, a będzie - jak to mówicie - git, gitara, nara! W wykonaniu tego zadania pomoże wam pewna dziewczyna imieniem Aldona. Znajdziecie ją w lokalnym zajeździe. Tylko ona może wam pomóc. Tak zatem... żegnajcie!", "FZB_4317_Akt3_1_a"},
["sounds.pac_08df21d9.ogg"] = {"To Aldona jest. Poznaliśmy ją w lokalnym zajeździe.", "Fred_Akt3_2_P_3158"},
