["sounds2.pac_036885e5.ogg"] = {"Owszem tak. Paraldehyd, ów produkt polimeryzacji trzech cząsteczek aldehydu octowego, to jeden z – jeśli można tak się wyrazić – najstarszych znajomych medycyny w ogólności, anestezjologii zaś w szczególności. Jest zarazem jednym z nasilniejszych środków, jakie można zdobyć drogami, prawda, legalnymi. Więc to nie jest też do końca tak jak z klasycznymi pochodnymi kwasu barbituranowego, ale zawsze... Ech... Proszę wybaczyć, ale nie mam głowy do tak przyziemnych rzeczy. Chwilowo poszukuję przystani. Tak właśnie. Bezpiecznej przystani.", "Lekarz_Akt2_P_3621"},
