["sounds2.pac_007c1ade.ogg"] = {"Nie odnosisz czasem wrażenia, że nikt w tym kraju - nawet pielęgniarki i górnicy po odprawie - nie ma tak ciężko przerąbane jak młodzi hip-hopowcy?", "Grucha_1572_Akt1_1"},
