["sounds2.pac_02774e12.ogg"] = {"Bestia! Bestia wyszła z morza i złożyła zad swój na plecach świata! Tak zostało zapisane w Piśmie i oto strzeżcie się, grzesznicy, gniewu naszego Pana! Chcecie podnieść rękę na rycerza Pana. Jam jest jego mieczem, jego głowicą, trzpieniem, trzonem, jelcem, taszką, ostrzem, zbroczem no i i... i tą pochwą!", "Jorge_2249Akt3_3"},
