["sounds2.pac_0072508d.ogg"] = {"I właśnie dlatego, drogie dzieci, należy pamiętać o wszelkiego rodzaju zabezpieczeniach. O wypadek - zwłaszcza na desce - nietrudno.", "Grucha_1426_Akt1_1"},
