["sounds2.pac_03769ce1.ogg"] = {"Cisza! Wy dwaj! Pojedziecie do Zgorzelca, do mojego ciotecznego szwagra. Jest zrośnięty ze swoimi czterema braćmi w niezwykle kłopotliwy sposób, ale udawajcie, że tego nie widzicie. Każdy z nich kręci własny interes. Weźmiecie teraz dzięgi z mojego supertajnego konta, do którego kartę bankomatową dałem wam trzynaście dni temu, i kupicie u mojego ciotecznego szwagra czterdzieści pięć megaton najlepszej uzbekistańskiej heroiny. Sprzedamy ją z zyskiem!! Ha, ha! Dzięki temu opanujemy świat i sczeszemy w opór klopsu! Idźcie, moje kafary! Idźcie, a chyżo!", "Mafioso_Pierwszy_2754_Akt1_2"},
