["sounds2.pac_03684d2e.ogg"] = {"Paraldehyd!", "Lekarz_Akt2_P_3615"},
["sounds2.pac_036450ad.ogg"] = {"Proszę zostawić te tabletki. Nie mogę bez nich spać. Eech... Ja ostatnio w ogóle bardzo źle sypiam. Kurczę, od zawsze źle spałem. O, już na studiach, już na studiach. Gdyby nie te problemy ze snem, to studia by lepiej poszły i byłbym już pewnie ordynatorem w jakimś porządnym mieście. Wie pan: pielęgniareczki, poczęstuneczki, sympozja, koperciki. To by było życie.", "Lekarz_Akt2_P_3597"},
